import styled from 'styled-components';
import { motion } from 'framer-motion';

const FooterContainer = styled.footer`
  background: ${({ theme }) => theme.gradients.purple};
  color: white;
  padding: 4rem 2rem;
  position: relative;
  overflow: hidden;
`;

const FooterContent = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 2rem;

  @media (max-width: ${({ theme }) => theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
    text-align: center;
  }
`;

const FooterSection = styled.div`
  h4 {
    font-size: 1.2rem;
    margin-bottom: 1.5rem;
    color: white;
  }
`;

const FooterLinks = styled.ul`
  list-style: none;
  padding: 0;

  li {
    margin-bottom: 0.8rem;
  }

  a {
    color: rgba(255, 255, 255, 0.8);
    text-decoration: none;
    transition: color 0.3s ease;

    &:hover {
      color: white;
    }
  }
`;

const CompanyInfo = styled.div`
  p {
    color: rgba(255, 255, 255, 0.8);
    margin-bottom: 1rem;
  }
`;

const Copyright = styled.div`
  text-align: center;
  margin-top: 3rem;
  padding-top: 2rem;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  color: rgba(255, 255, 255, 0.8);
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <CompanyInfo>
          <h4>CypherBox</h4>
          <p>Powering the Future of AI and Cloud Computing</p>
          <p>High-performance, scalable, and reliable data centers for innovators.</p>
        </CompanyInfo>

        <FooterSection>
          <h4>Quick Links</h4>
          <FooterLinks>
            <li><a href="/about">About Us</a></li>
            <li><a href="/services">Services</a></li>
            <li><a href="/pricing">Pricing</a></li>
            <li><a href="/contact">Contact</a></li>
          </FooterLinks>
        </FooterSection>

        <FooterSection>
          <h4>Services</h4>
          <FooterLinks>
            <li><a href="/services/ai-computing">AI Computing</a></li>
            <li><a href="/services/cloud-storage">Cloud Storage</a></li>
            <li><a href="/services/data-centers">Data Centers</a></li>
            <li><a href="/services/enterprise">Enterprise Solutions</a></li>
          </FooterLinks>
        </FooterSection>

        <FooterSection>
          <h4>Contact Us</h4>
          <FooterLinks>
            <li>Email: info@cypherbox.com</li>
            <li>Phone: +1 (555) 123-4567</li>
            <li>Location: Silicon Valley, CA</li>
          </FooterLinks>
        </FooterSection>
      </FooterContent>

      <Copyright>
        <p>&copy; {new Date().getFullYear()} CypherBox. All rights reserved.</p>
      </Copyright>
    </FooterContainer>
  );
};

export default Footer;
